import React from "react";
import { init } from "ityped";

const About = () => {
    const textRef = useRef();
    useEffect(() => {
        init(textRef.current, {
            showCursor: true,
            strings: ["Front-end Developer"],
        });
    }, []);
    return <div>About</div>;
};

export default About;
